import { intersection } from './intersection';
describe('data_first', function () {
    test('intersection', function () {
        expect(intersection([1, 2, 3], [2, 3, 5])).toEqual([
            2,
            3,
        ]);
    });
});
describe('data_last', function () {
    test('intersection', function () {
        expect(intersection([2, 3, 5])([1, 2, 3])).toEqual([
            2,
            3,
        ]);
    });
});
